import React from "react";
import { ContentHome } from "../../Styles/ContentHome";
import { content } from "../../Imports/Image";
import Buttons from "../Buttons/Buttons";
import SwiperCore, { EffectFade, Mousewheel, Pagination } from "swiper";
SwiperCore.use([Mousewheel, Pagination, EffectFade]);
const swiperOptions = {
  direction: "vertical",
  slidesPerView: 1,
  spaceBetween: 0,
  mousewheel: true,
  pagination: true,
  effect: "cube",
  speed: 1000,
};
const champImgs = [];
const Content = () => {
  return (
    <>
      <ContentHome>
        <section className="home" id="home">
          <div className="content">
            <h3>food made with love</h3>
            <p>
              Lorem ipsum dolor sit, amet consectetur adipisicing elit. Voluptas
              accusamus tempore temporibus rem amet laudantium animi optio
              voluptatum. Natus obcaecati unde porro nostrum ipsam itaque
              impedit incidunt rem quisquam eos!
            </p>

            <Buttons css="btn" name="order now" />
          </div>

          <div className="image">
            <img src={content} alt="" />
          </div>
        </section>
      </ContentHome>
    </>
  );
};

export default Content;
